ControlPropertyState.AutoRuleBindingString:
// Calcula se é sábado ou domingo
UpdateContext({
    varFinalSemana:
    Text(Today(), "dddd", "pt-BR") = "sábado" || Text(Today(), "dddd", "pt-BR") = "domingo"
});

// Busca pesquisas pendentes
UpdateContext({
    varTemPesquisa:
    CountRows(
        Filter(
            DropColumns(db_nps_infra, 'Criado por'),
            Tk_Status_NPS = "Aguardando Pesquisa",
            Tk_Solicitante = VarUsuario.Email
        )
    ) > 0
});

// Lógica principal
If(
    varFinalSemana && varTemPesquisa,
        Notify("Nosso atendimento é de segunda a sexta-feira. Mas você pode aproveitar para responder às pesquisas de satisfação pendentes.", NotificationType.Warning, 15000);
        Navigate(TI_Pesquisa, Transition.Pop),

    varFinalSemana && !varTemPesquisa,
        Notify("Nosso atendimento para abertura de chamados está disponível apenas de segunda a sexta-feira. Retorne na segunda e será um prazer lhe atender!", NotificationType.Warning, 15000),

    !varFinalSemana && varTemPesquisa,
        Notify("Você possui pesquisas de satisfação pendentes. Para abrir um novo chamado, responda primeiro às pesquisas dos chamados já concluídos.", NotificationType.Warning, 15000);
        Navigate(TI_Pesquisa, Transition.Pop),

    !varFinalSemana && !varTemPesquisa,
        Navigate(TI_Chamados, Transition.Pop)
);

UpdateContext({
    varFinalSemana: Blank(),
    varTemPesquisa: Blank()
    }
)

// Calcula se é sábado ou domingo
UpdateContext({
    varFinalSemana:
    Text(Today(), "dddd", "pt-BR") = "sábado" || Text(Today(), "dddd", "pt-BR") = "domingo"
});

// Busca pesquisas pendentes há mais de 10 dias
UpdateContext({
    varTemPesquisa:
    CountRows(
        Filter(
            DropColumns(db_nps_dev, 'Criado por'),
            Tk_Status_NPS = "Aguardando Pesquisa",
            Tk_Solicitante = VarUsuario.Email,
            DateDiff(Criado, Today(), TimeUnit.Days) > 10
        )
    ) > 0
});

// Lógica principal
If(
    varFinalSemana && varTemPesquisa,
        Notify("Nosso atendimento para abertura de chamados está disponível apenas de segunda a sexta-feira.
        Aproveite para responder as pesquisas de satisfação de serviços concluídos há mais de 10 dias e que ainda não foram respondidas.", NotificationType.Warning, 15000);
        Navigate(DI_Pesquisa, Transition.Pop),

    varFinalSemana && !varTemPesquisa,
        Notify("Nosso atendimento para abertura de chamados está disponível apenas de segunda a sexta-feira. Retorne na segunda e será um prazer lhe atender!", NotificationType.Warning, 15000),

    !varFinalSemana && varTemPesquisa,
        Notify("Você possui pesquisas de satisfação referentes a serviços concluídos há mais de 10 dias e que ainda não foram respondidas.
        Para abrir um novo chamado, é necessário responder essas pesquisas pendentes.", NotificationType.Warning, 15000);
        Navigate(DI_Pesquisa, Transition.Pop),

    !varFinalSemana && !varTemPesquisa,
        Navigate(DI_Chamados, Transition.Pop)
);

// Limpa variáveis de controle (boa prática)
UpdateContext({
    varFinalSemana: Blank(),
    varTemPesquisa: Blank()
})
